import React from "react";
import SearchIcon from "@material-ui/icons/Search";
import ClearIcon from "@material-ui/icons/Clear";

const SearchDate = (props) => {
  return (
    <div>
      {props.label}
      <input type="date" placeholder="enter date" onChange={props.handleSearchDate}/>
    </div>
  )
};

class SearchAppBar extends React.Component {
  state = {
    text: "",
    dueDate: "",
    priority: false,
    completed: false,
    datePickerIsOpen: false
  };
  render() {
    return (
      <div style={{ display: "flex", marginTop: "5px" }}>
        <SearchIcon style={{marginTop: '5px'}}/>
        <input
          style={{ width: "60%", paddingLeft: "5px" }}
          placeholder="enter search text"
          onChange={this.props.handleSearchText}
        />
        <SearchDate label="filter date" handleSearchDate={this.props.handleSearchDate}/>
      </div>
    );
  }
}

export default SearchAppBar;
